$.fn.flyout_dialog = function(dialog_selector, callback){
  var button               = this,
      has_hovercard_parent = button.parents("#hovercard").data("active"),
      dialog               = $(dialog_selector),
      offsets              = {
        top: 35,
        left: -6
      },
      dialog_is_abs_center = dialog.hasClass('centered'),
      dialog_type          = dialog.attr('role') || '',
      ESCAPE_KEY           = 27,
      $document            = $(document),
      active_button;

  prepareDataDialog();

  if (callback) {
    callback();
  }

  function getClickPosition() {
    var button_coords = active_button.offset(),
        button_coords_left = (button_coords.left + offsets.left);
        button_coords_top = (button_coords.top + offsets.top);

    return {
      left: button_coords_left,
      top: button_coords_top
    };
  }

  function prepareDataDialog() {
    button.on('click keypress', function(e) {

      if (appBuilder.utilities.a11yClick(e)) {
        active_button = $(this);

        appBuilder.utilities.removeDialogs();

        if (!active_button.attr('confirmed')) {
          dialog.data('original', active_button);

          e.preventDefault();
          e.stopPropagation();
          appBuilder.utilities.overlay.enable();
          appBuilder.utilities.overlay.increaseZindex();

          openDialog();
          setDialogFocus();
        }

        $(window).on("resize", positionDialogNearClick);
        $(window).on("resize", verticallyCenterDialog);

        $(".slideout_item").onEnd("transition", positionDialogNearClick);
      }
    });

    $document.keyup(function(e) {
      if (e.keyCode === ESCAPE_KEY && dialogIsActive()) {
        dialog.find('.cancel_dialog').click();
      }
    });

    dialog.on('ajax:before', '[data-dialog][data-remote]', function() {
      return false;
    });

    dialog.on('click', '.dialog_confirm', function(e) {
      closeDialog(e);
      dialog.data('original').attr('confirmed', 'confirmed').click();
    });

    dialog.on('click', '.cancel_dialog', function(e) {
      closeDialog(e);
      $('.select2-drop-mask').click();
    });
  }

  function closeDialog(e) {
    $document.trigger("dialog:closed");
    e.preventDefault();
    e.stopImmediatePropagation();
    removeOverlayAndDialogs();

    if (active_button && !has_hovercard_parent) {
      active_button.focus();
    }
  }

  function removeOverlayAndDialogs() {
    appBuilder.utilities.overlay.disable();
    appBuilder.utilities.removeDialogs();
  }

  function setDialogFocus() {
    if ((dialog_type === 'dialog' || dialog_type === 'alertdialog') &&
          dialog.hasClass('confirmation') &&
          dialogIsActive()) {
      dialog
        .find('.button, [type=submit]')
        .first()
        .focus();
    } else {
      dialog.focus();
    }
  }

  function positionDialogNearClick() {
    if (dialog_is_abs_center) { return; }

    var browser_width = $(window).width(),
        dialog_width  = dialog.width(),
        position      = getClickPosition();

    dialog.css({
      top: position.top,
      left: (position.left - dialog_width)
    });
  }

  function verticallyCenterDialog() {
    dialog.css({
      marginTop: -(dialog.outerHeight() * 0.5)
    });
  }

  function openDialog() {
    if (dialog_is_abs_center) {
      verticallyCenterDialog();
    } else {
      positionDialogNearClick();
    }

    dialog.attr('aria-hidden', 'false');
  }

  function dialogIsActive() {
    return dialog.attr('aria-hidden') === 'false';
  }
};
