cxo.admin_mode = {
  switch_form_label : null,         // the switch label
  switch_label_text : null,         // the textual state of admin mode
  switch_checkbox   : null,         // the switch checkbox
  edit_links        : null,         // the edit links
  current_mode      : null,         // current admin mode state
  debug_container   : null,         // the debugging container
  wrapper           : null,         // the page wrapper
  key               : "admin_mode", // localStorage key

  init: function($parent) {
    this.edit_links        = $(".widget_header_action_link.editable");
    this.wrapper           = $("#wrapper");
    this.switch_label_text = $parent.find(".admin_menu .label_text");
    this.switch_form_label = $parent.find(".admin_menu .switch label");
    this.switch_checkbox   = $parent.find(".admin_mode_switch");
    this.debug_container   = $("#query_debugging");
    this.bindings();
    this.updateCurrentMode();
    this.updateUI();
    this.updateSwitchState(); // only occurs on initial load
  },

  bindings: function() {
    this.switch_checkbox.on("checkbox:changed", $.proxy(this.toggleEditMode, this));
    this.debug_container.onEnd("transition",
                                $.proxy(this.removeDebuggingBorder, this),
                                "max-height");
  },

  updateUI: function() {
    this.updateLinkState();
    this.updateWrapperClass();
    this.updateAllSwitches();
    this.updateDebuggingState();
  },

  updateWrapperClass: function() {
    if (this.getCurrentMode() === "enabled") {
      this.wrapper.addClass(this.key);
    } else {
      this.wrapper.removeClass(this.key);
    }
  },

  updateLinkState: function() {
    var mode = this.getCurrentMode() === "enabled" ? "false" : "true";
    this.edit_links.attr("aria-hidden", mode);
  },

  updateSwitchState: function() {
    if (this.getCurrentMode() === "enabled") {
      this.switch_checkbox.addClass("checked");
    }
  },

  updateAllSwitches: function() {
    var all_switches = $('.admin_mode_switch');

    if (this.getCurrentMode() === "enabled") {
      all_switches.attr('checked', 'checked').addClass('checked');
    } else {
      all_switches.attr('checked', '').removeClass('checked');
    }
  },

  updateDebuggingState: function() {
    var mode = this.getCurrentMode() === "enabled" ? "false" : "true";
    if (mode === "false") {
      this.debug_container.removeClass("no_border");
    }
    this.debug_container.attr("aria-hidden", mode);
  },

  removeDebuggingBorder: function() {
    if (this.getCurrentMode() !== "enabled") {
      this.debug_container.addClass("no_border");
    }
  },

  toggleEditMode: function() {
    var storage_value = this.getCurrentMode() === "enabled" ? "disabled" : "enabled";
    appBuilder.utilities.setWebStorage(this.key, storage_value);
    this.updateCurrentMode();
    this.updateUI();
  },

  getCurrentMode: function() {
    return this.current_mode;
  },

  updateCurrentMode: function() {
    this.current_mode = appBuilder.utilities.getWebStorage(cxo.admin_mode.key) || "enabled";
  }
};
