appBuilder.Carousel = function(id) {
  this.widget_id    = id;
  this.carousel_element = $('#content [data-widget-id="' + this.widget_id + '"]');

  if (!this.carousel_element.length) {
    return;
  }

  user_id = appBuilder.utilities.getUserId();

  this.carousel_position      = 0;
  this.storage_key            = user_id + '_' + this.widget_id + '_index';
  this.arrow_left             = this.carousel_element.find('.carousel_arrow.left');
  this.arrow_right            = this.carousel_element.find('.carousel_arrow.right');
  this.arrow_left_background  = this.arrow_left.find('.carousel_arrow_background');
  this.arrow_right_background = this.arrow_right.find('.carousel_arrow_background');
  this.drop_down_button       = this.carousel_element.find('.current_widget_title_button');
  this.drop_down_menu         = this.carousel_element.find('.carousel.dropdown');
  this.drop_down_items        = this.drop_down_menu.find('li');
  this.has_initilized         = false;
  this.init();
};

appBuilder.Carousel.prototype = {
  init : function () {
    var index_from_storage = appBuilder.utilities.getWebStorage(this.storage_key);

    this.current_index = typeof index_from_storage !== 'undefined' ? parseInt(index_from_storage, 10) : 0;
    this.widgets       = this.carousel_element.find('.widget, .spotlight_tab');
    this.wrapper       = this.carousel_element.find('.carousel_content > .widget_inside');
    this.widget_length = this.widgets.length;
    this.widget_width  = (100 / this.widget_length);

    this.widgets.width(this.widget_width + '%');

    if (this.current_index > this.widget_length - 1) {
      this.current_index = 0;
    }

    if (!this.is_binded) {
      this.createListeners();
    }

    if (!this.isLoading() && !this.has_initilized) {
      this.has_initilized = true;

      if (this.widget_length < 1) {
        return;
      }

      this.carousel_element.removeClass('loading');

      this.removeHiddenWidgetDisplayName();
      this.buildWidgetPosition();
      this.updateWrapperWidth();
      this.gotoIndexPosition(false);
      this.determineArrowState();
    } else if (this.isLoading()) {
      this.drop_down_button.html(HandlebarsTemplates["global/spinner"]({show_text: true}));
      this.carousel_element.addClass('loading');
    }
  },

  createListeners: function() {
    this.bindEvents();

    if ('ontouchstart' in window) {
      this.bindMobileEvents();
    }

    this.is_binded = true;
  },

  bindEvents: function() {
    var $doc = $(document),
        self = this;

    new Dropdown({
      button: this.drop_down_button,
      menu  : this.drop_down_menu
    });

    this.carousel_element.find('.carousel_arrow').on('click', function() {
      var $this = $(this);

      if (self.wrapper.hasClass('no-animate')) {
        self.wrapper.removeClass('no-animate');
      }

      if ($this.hasClass('right')) {
        self.current_index++;
      } else {
        self.current_index--;
      }

      self.gotoIndexPosition(true);
      self.determineArrowState(true);
    });

    this.drop_down_items.on('click', function(event) {
      event.preventDefault();
      self.current_index = $(this).index();

      self.gotoIndexPosition(false);
      self.determineArrowState();

      self.drop_down_menu.attr('aria-hidden', true);

      if (self.carousel_element.hasClass('minimized')) {
        self.carousel_element.find('.carousel_header_actions .restore').trigger('click');
      }
    });

    $doc.on('layout_updated', function() {
      self.init(this.widget_id);
    });

    $doc.on('asyncLoadComplete', function() {
      if (self.isLoading()) {
        return;
      }

      self.init();
    });

    $(window).on('resize', function() {
      self.updateWrapperWidth();
    });
  },

  bindMobileEvents: function() {
    var x_down   = 0,
        y_down   = 0,
        prev     = false,
        next     = false,
        timeout  = 1000,
        max_dis  = 30,
        self     = this;

    this.carousel_element.on('touchstart', function(event) {
      $(this).trigger('mouseup');
      x_down = event.originalEvent.touches[0].clientX;
      y_down = event.originalEvent.touches[0].clientY;
    });


    this.carousel_element.on('touchmove', function(event) {
      var xUp    = event.originalEvent.touches[0].clientX,
          yUp    = event.originalEvent.touches[0].clientY,
          x_diff = x_down - xUp,
          y_diff = y_down - yUp,
          abs_x  = Math.abs(x_diff);

      if (abs_x > Math.abs(y_diff)) {
        if (abs_x > max_dis) {
          abs_x = max_dis;
        }

        var percentage = (abs_x / max_dis);

        if (x_diff > 0) {
          self.arrow_right_background.css('opacity', percentage);
          self.arrow_left_background.css('opacity', '0');

          prev = false;
          next = abs_x === max_dis;

        } else {
          self.arrow_left_background.css('opacity', percentage);
          self.arrow_right_background.css('opacity', '0');

          next = false;
          prev = abs_x === max_dis;
        }
      }
    });

    this.carousel_element.on('touchend', function(event) {
      if (prev && self.arrow_left.is(':visible')) {
        self.arrow_left.trigger('click');
        prev = false;
      } else if (next && self.arrow_right.is(':visible')) {
        self.arrow_right.trigger('click');
        next = false;
      }
      $(this).find('.carousel_arrow_background').css('opacity', '0');
    });
  },

  updateHeight: function(height) {
    this.carousel_element.find('> .carousel_content').css('min-height', height);
  },

  updateWrapperWidth: function() {
    wrapper_width = this.carousel_element.parent().width() * this.widget_length;
    this.wrapper.width(wrapper_width);
  },

  updateDropdown: function() {
    var $selected_item      = this.drop_down_menu.find('li').eq(this.current_index),
        $selected_item_text = $selected_item.text();

    this.drop_down_items.removeClass('active');
    $selected_item.addClass('active');
    this.drop_down_button
      .text($selected_item_text)
      .attr('title', $selected_item_text);
  },

  gotoIndexPosition: function(with_animation) {
    var widgets         = this.widgets,
        $current_widget = widgets.eq(this.current_index);

    this.carousel_position = $current_widget.data('position');

    widgets.removeClass('active');
    $current_widget.addClass('active');

    widgets.attr('aria-hidden', true);
    $current_widget.attr('aria-hidden', false);

    if (!with_animation) {
      this.wrapper.addClass('no-animate');
    }

    this.wrapper.css('transform', 'translate(' + -this.carousel_position + '%)');

    this.updateHeight(widgets.eq(this.current_index).height());
    this.updateDropdown();
    this.updateEditLink($current_widget);

    appBuilder.utilities.setWebStorage(this.storage_key, this.current_index.toString());
  },

  updateEditLink: function($current_widget) {
    var current_edit_link = $current_widget.find(".editable a"),
        current_title     = current_edit_link.attr("title"),
        current_href      = current_edit_link.attr("href");

    this.carousel_element.find('.carousel_edit_link').attr({
      "href"  : current_href,
      "title" : current_title
    });
  },

  buildWidgetPosition: function() {
    var self = this;
    this.widgets.each(function() {
      $(this).attr('data-position', self.carousel_position);
      self.carousel_position += self.widget_width;
    });
  },

  determineArrowState: function(triggered_from_arrow) {
    if (this.current_index === this.widget_length - 1) {
      this.arrow_right.hide();
      this.drop_down_button.focus();
    } else {
      this.arrow_right.show();
    }

    if (this.current_index === 0) {
      this.arrow_left.hide();
      this.drop_down_button.focus();
    } else {
      this.arrow_left.show();
    }

    if (!triggered_from_arrow) {
      this.drop_down_button.focus();
    }
  },

  isLoading: function() {
    return this.carousel_element.find('.loading').length > 0;
  },

  /* If display conditions on a widget are set to false,
     remove the title from the dropdown to prevent user
     from navigating to an empty widget */
  removeHiddenWidgetDisplayName: function() {
    var self = this;
    this.wrapper.find('> .widget_container').each(function(i) {
      if (!$(this).children().length > 0) {
        self.drop_down_items.eq(i).remove();
      }
    });
  }
};
