cxo.column_toggle = {

  initColumnToggle: function($table) {
    var classes                   = {
          column_toggle          : 'columntoggle',
          column_toggle_table    : 'columntoggle_table',
          dropdown               : 'columntoggle_dropdown',
          dropdown_open          : 'columntoggle_dropdown_open',
          dropdown_wrapper       : 'columntoggle_dropdown_wrapper',
          columns_hidden_overlay : 'columntoggle_columns_hidden_overlay',
          priority_prefix        : 'columntoggle_priority_',
          active_class           : 'active',
          toolbar_class          : 'dataTables_toolbar',
          footer_class           : 'dataTables_footer',
          dataTables_wrapper     : 'dataTables_wrapper',
          hidden_class           : 'columntoggle_cell_hidden',
          visible_class          : 'columntoggle_cell_visible'
        },
        i18n                      = {
          all_columns_hidden     : I18n.t('app.widgets.table.all_columns_hidden'),
          columns_dropdown_error : I18n.t('app.widgets.table.columns_dropdown_error'),
          dropdown_open_title    : I18n.t('app.widgets.table.dropdown_open_title')
        },
        table_id                  = $table.attr("id"),
        dropdown_id               = table_id + "_dropdown",
        dropdown_wrapper_id       = dropdown_id + "_wrapper",
        dropdown_open_id          = dropdown_id + "_open",
        columns_hidden_overlay_id = table_id + "_columns_hidden_overlay",
        widget_id                 = $table.closest("section[data-widget-id]")
                                      .attr("data-widget-id"),
        str_column_visibility     = appBuilder.utilities.getWebStorage(widget_id),
        column_visibility         = str_column_visibility ?
                                      JSON.parse(str_column_visibility) : {},
        min_priority              = 0,
        max_priority              = 6,
        $dropdown                 = $("#" + dropdown_id),
        $dropdown_open            = $("#" + dropdown_open_id),
        $columns_hidden_overlay   = $("#" + columns_hidden_overlay_id);

    if($table.hasClass(classes.column_toggle_table)) {
      bindColumnsToDropdown(retrieveCellsInColumns());
    } else{
      buildAndInitializeTableControls();
      cleanStoredVisibility();
      bindColumnsToDropdown(retrieveCellsInColumns());
      setTriggers();
      refreshCheckboxes();
    }

    function buildAndInitializeTableControls() {

      var dropdown            = {
            "tag"         : "div",
            "id"          : dropdown_id,
            "class"       : classes.dropdown,
            "aria-hidden" : true,
            "children"    : [{
              "tag"           : "ul",
              "role"          : "menu",
              "aria-controls" : table_id
            }]
          },
          dropdown_wrapper    = {
            "tag"      : "div",
            "id"       : dropdown_wrapper_id,
            "class"    : classes.dropdown_wrapper,
            "children" : [{
              "tag"           : "button",
              "id"            : dropdown_open_id,
              "role"          : "status",
              "class"         : classes.dropdown_open,
              "title"         : i18n.dropdown_open_title,
              "aria-label"    : i18n.dropdown_open_title,
              "aria-haspopup" : true,
              "aria-live"     : "assertive"
            }]
          },
          columns_hidden_overlay  = {
            "tag"         : "div",
            "id"          : columns_hidden_overlay_id,
            "class"       : classes.columns_hidden_overlay,
            "aria-hidden" : true,
            "children"    : [{
              "tag"  : "text",
              "text" : i18n.all_columns_hidden
            }]
          },
          $dropdown_wrapper       = $(dropdown_wrapper).convertJSONToHTML(),
          $data_table_wrapper     = $table.closest("." + classes.dataTables_wrapper);

      //create and store dropdown, button, and overlay
      $dropdown = $(dropdown).convertJSONToHTML();
      $dropdown_open = $dropdown_wrapper.find("." + classes.dropdown_open);
      $columns_hidden_overlay = $(columns_hidden_overlay).convertJSONToHTML();

      //add HTML blocks to DOM
      $dropdown_wrapper.append($dropdown);
      $table.addClass(classes.column_toggle_table);

      //since datatables adds extra wrappers, need to check for their existence
      //before appending the other elements so that column toggle can standalone
      if($data_table_wrapper.length > 0) {
        $data_table_wrapper
          .addClass(classes.column_toggle)
          .append($columns_hidden_overlay)
          .find("." + classes.toolbar_class)
          .append($dropdown_wrapper);
      } else {
        $table
          .before($dropdown_wrapper)
          .wrap("<div class='responsive_table_wrapper'></div>")
          .parent()
          .append($columns_hidden_overlay);
      }

      //initialize the dropdown show/hide on click
      new Dropdown({
        button   : $dropdown_open,
        menu     : $dropdown,
        callback : function(menu_element) {
          var is_visible = menu_element.attr("aria-hidden") === "true" ? true : false;
          $dropdown_open.toggleClass(classes.active_class, !is_visible);
        }
      });

      $(window).on("resize." + widget_id, function() {
        refreshCheckboxes();
      });
    }

    function retrieveCellsInColumns() {

      var column_array = [],
          col_tally    = 0;

      $table.find("thead th:not(.toggle_disabled)").each( function() {
        var $header  = $(this),
            priority = $header.attr("data-priority"),
            sel      = ":nth-child(" + (col_tally + 1) + ")";

          //gets all the cells that are not headers that are the :nth-child
          column_array.push($header.add($table.find("tr")
            .not($table.find("thead tr").eq(0))
            .not(this)
            .children(sel)));
          col_tally++;

      });
      return column_array;
    }

    function bindColumnsToDropdown(column_array) {

      var $menu                = $dropdown.find("ul"),
          total_toggle_headers = $table.find("thead th")
                                   .not('[data-priority="0"]')
                                   .length,
          current_index        = -1;

      $table.find("thead th").each( function (index) {
        var $header      = $(this),
            header_text  = getText($header),
            priority     = $header.attr("data-priority"),
            is_checked   = false,
            $cells       = $(column_array[index])
                            .addClass(classes.priority_prefix + priority),
            checkboxJSON = {
              "tag"      : "li",
              "role"     : "menuitem",
              "children" : [{
                "tag"      : "label",
                "children" : [{
                  "tag"              : "input",
                  "type"             : "checkbox",
                  "aria-label"       : header_text,
                  "aria-describedBy" : dropdown_open_id,
                  "aria-controls"    : table_id
                },
                {
                  "tag"  : "text",
                  "text" : header_text
                }]
              }]
            };

        //verify that there exists a toggle column (has priority > min_priority)
        if(priority && priority > min_priority) {
          current_index++;
          if(header_text in column_visibility) {
            is_checked = column_visibility[header_text] <= max_priority;
          } else{
            rememberStoredVisibility(header_text, priority);
          }

          //see if the checkboxes are already created
          if($menu.children().length < total_toggle_headers) {
            if(is_checked) {
              checkboxJSON.children[0].children[0]["aria-checked"] = is_checked;
              checkboxJSON.children[0].children[0]["checked"] = "";
            }

            $(checkboxJSON)
              .convertJSONToHTML()
              .appendTo($menu)
              .find("[type='checkbox']")
              .data("cells", $cells);
          } else{
            $menu.find("[type='checkbox']")
              .eq(current_index)
              .data("cells", $cells);
          }

          //if local storage already is assigned to be invisible, set it
          setManualOverrideClass($cells, column_visibility[header_text]);
        }
      });

      $menu.find("[type='checkbox']")[0].disabled = true;

      if(total_toggle_headers <= 0){
        checkboxJSON.children = [{
          "tag"  : "text",
          "text" : i18n.columns_dropdown_error
        }];
        $menu.append($(checkboxJSON).convertJSONToHTML());
      }

      //make sure the widget isn't smaller than the dropdown when expanded
      setWidgetMinHeight();
    }

    function cleanStoredVisibility() {
      var current_column_headers = [];
      $.each($table.find("thead th"), function(){
        current_column_headers.push(getText($(this)));
      });

      $.each(column_visibility, function(key){
        if($.inArray(key, current_column_headers) < 0) {
          delete column_visibility[key];
        }
      });

      refreshLocalStorage();
    }

    function rememberStoredVisibility(header_text, priority) {
      column_visibility[header_text] = priority;
      refreshLocalStorage();
    }

    function refreshLocalStorage() {
      appBuilder.utilities
        .setWebStorage(widget_id, JSON.stringify(column_visibility));
    }

    function setTriggers() {
      //bind change event to the show/hide of the table columns
      $dropdown.find("[type='checkbox']")
        .on("change", function(e) {
          toggleColumnVisibility(this, e.target.checked);
      });
    }

    function toggleColumnVisibility(checkbox, is_checked) {
      var header_text = getText($(checkbox).parent()),
          $checkbox   = $(checkbox),
          priority    = is_checked ? min_priority : max_priority + 1;
      $checkbox.attr("aria-checked", is_checked);
      $checkbox.prop("checked", is_checked);
      $checkbox.data("cells")
        .toggleClass(classes.hidden_class, !is_checked)
        .toggleClass(classes.visible_class, is_checked);

      rememberStoredVisibility(header_text, priority);
      updateColumnShowingCount();
    }

    function setManualOverrideClass($cells, priority) {
      if(priority <= min_priority) {
        $cells.addClass(classes.visible_class);
      } else if(priority > max_priority) {
        $cells.addClass(classes.hidden_class);
      }
    }

    function updateColumnShowingCount() {
      var columns_showing = 0,
          total_columns   = 0,
          arrow_svg       = {
            "tag"           : "svg",
            "class"         : "svg_icon sort-down",
            "children"      : [{
              "tag"         : "use",
              "xlink:href"  : "#icon-sort-down"
            }]
          };
      $table.find("thead th:not(.toggle_disabled)").each( function() {
        total_columns++;
        if($(this).css("display") === "table-cell") {
          columns_showing++;
        }
      });
      $dropdown_open.html(I18n.t('app.widgets.table.column_showing_count', {showing_cols: columns_showing, total_cols: total_columns}));
      $dropdown_open.append($(arrow_svg).convertJSONToHTML());
    }

    function refreshCheckboxes() {
      $dropdown.find("[type='checkbox']")
        .each( function() {
          var is_checked = $(this).data("cells")
                            .eq(0)
                            .css("display") == "table-cell";
          $(this)
            .prop("checked", is_checked)
            .attr("aria-checked", is_checked);
      });
      updateColumnShowingCount();
    }

    function getText($element) {
      return $.trim($element.text());
    }

    function setWidgetMinHeight() {
      $columns_hidden_overlay.css("line-height", $dropdown.height() + "px");
      $columns_hidden_overlay.parent().css("min-height",
        ($dropdown_open.height() + $dropdown.height()) + "px");
    }
  }
};
