cxo.commenting = {
  init: function() {
    var selectActiveItem = function(event) {
        var selector = event.data.selector || "li";

        $(this)
          .closest(selector)
          .attr("aria-selected", "true");
        },

        resetTextarea = function(event) {
          var starting_textarea_height = event.data.starting_textarea_height || "2.78em",
              selector = event.data.selector || "textarea";

          $(this)
            .find(selector)
            .css({height: starting_textarea_height})
            .val("")
            .focus();
        };

    $("#content").on("click", ".show_comments", function(event) {
      event.preventDefault();
      var show_comment_toggle = $(this),
          comment_list        = show_comment_toggle.closest(".result").find(".comments_list"),
          comment_body        = comment_list.find(".comment_body"),
          placeholderCallback;

      comment_list.hasClass("show") ? comment_body.blur() : comment_body.focus();
      comment_list.toggleClass("show");

      if (!appBuilder.utilities.supportsPlaceholder() && comment_list.hasClass("show")) {
        placeholderCallback = function() {
          var comment_text     = comment_body.val(),
              placeholder_text = comment_body.attr("placeholder");

          if (comment_text === placeholder_text) {
            comment_body.val("");
          }
        };
        $.event.trigger("asyncPlaceholder", [ placeholderCallback ]);
      }
    });

    $(".comments").on(
      'ajax:send',
      '.remove_comment_form',
      {},
      selectActiveItem
    );

    $(".comments").on(
      'ajax:success',
      '.add_comment_form',
      {},
      resetTextarea
    );

    $(".comments").on('ajax:success', '.remove_comment_form', function() {
      var updateCommentCount = function(comment) {
            var comment_list       = comment.closest(".comments"),
                show_comments_link = comment_list.find(".show_comments"),
                number_of_comments = comment_list.find("li").length-1;

            show_comments_link.text(
              I18n.t("app.widgets.search_results.comments_link.comment_message",
                      {count: number_of_comments})
            );

            var bolded_comments = comment_list.find(".bolded_comments"),
                bolded_comments_text = comment_list.find(".bolded_comments_text"),
                number_of_bolded = comment_list.find(".bolded").length,
                comment_verb;

            if (comment.hasClass("bolded")) {
              number_of_bolded--;
            }

            if (number_of_bolded > 0) {
              bolded_comments_text.text(
                I18n.t("app.widgets.search_results.comments_link.bolded_message",
                      {count: number_of_bolded})
              );
            } else {
              bolded_comments.remove();
            }
          };

      $(this)
        .closest(".comment")
        .addClass("remove_comment")
        .onEnd("animation", function() {
          updateCommentCount($(this));
          $(this).remove();
          appBuilder.utilities.announce(I18n.t("app.widgets.search_results.comment_removed"));
        });
    });
  }
};
