cxo.export_entities = {
  obj_exists: false,
  init: function(max, dialog_id) {
    var $slider        = $("#number_to_export_slider"),
        $display       = $("#number_to_export"),
        $export_button = $(".icon_button.export"),
        $export_submit = $("#export_submit"),
        min_results    = 1,
        max_results    = (max > 10000) ? 10000 : max,
        updateDisplay = function() {
          var slider_value = $slider.slider("option", "value");
          $display.val(slider_value);
        },
        updateSliderMarkup = function() {
          $slider
            .find(".ui-slider-handle")
            .html('<span class="hide_absolutely">' +
                  I18n.t("app.shared.dialogs.export_entities.slider_title") +
                  '</span>');
        },
        createMarkers = function() {
          if (max_results > 1) {
            $slider.append(
              '<div id="number_to_export_markers">' +
              '<span class="marker min">' + min_results + '</span>' +
              '<span class="marker max">' + max_results + '</span>' +
              '</div>'
            );
          }
        },
        focusOnExportButton = function() {
          $export_button.focus();
        };

    this.obj_exists = true;

    $display.on("change paste", function() {
      var display_value = $(this).val();

      if (!appBuilder.utilities.isWholeNumber(display_value)) {
        display_value = min_results;
      } else {

        if (display_value < min_results) {
          display_value = min_results;
        }

        if (display_value > max_results) {
          display_value = max_results;
        }
      }

      $slider.slider("option", "value", display_value);
    });

    $slider.slider({
      value: $display.val(),
      min: min_results,
      max: max_results,
      change: updateDisplay,
      slide: updateDisplay
    });

    /* firefox back/forward cache remembers the input value
     * but not the display text so we need to set the display
     * text on init.
     */
    updateDisplay();
    updateSliderMarkup();
    createMarkers();

    $export_button.flyout_dialog("#" + dialog_id, function() {
      $export_submit.on("click", function() {
        appBuilder.utilities.triggerKey(27, "up");
      });
    });
  }
};
