cxo.filter = {
  init: function(widget_id, is_datatable, is_array) {
    var $table,
        $term_filter,
        $filter_form,
        $filter_text,
        $icon_clear,
        filter_delay = is_array ? 0 : 400,
        filter_timeout,
        previous_filter_value;

    if (is_datatable) {
      $table       = $("#" + widget_id + "_table");
      $term_filter = $("#" + widget_id + "_table_filter");
      $filter_text = $term_filter.find("input");
      $icon_clear  = $term_filter.find(".clear_filter_button");

      $filter_text.attr("type", "text").addClass("filter_text")
                  .off("keyup.DT search.DT input.DT paste.DT cut.DT");

      $table.DataTable().on("xhr", function () {
        isFiltered($filter_text.val(), $term_filter);
      });
    } else {
      $term_filter = $("." + widget_id +" .term_filter");
      $filter_form = $term_filter.children("form");
      $filter_text = $filter_form.children(".filter_text");
      $icon_clear  = $filter_form.children(".clear_filter_button");

      $term_filter.on("ajax:success", function() {
        isFiltered($filter_text.val(), $term_filter);
      });
    }

    $filter_text.on("keydown change paste", function() {
      clearTimeout(filter_timeout);

      filter_timeout = setTimeout(function () {
        var filter_value = $filter_text.val();
        if (filter_value != previous_filter_value) {
          if (!is_array) {
            $term_filter.attr("aria-busy", true);
          }

          if (is_datatable) {
            $table.DataTable().search(filter_value).draw();
          } else {
            $filter_form.submit();
          }
        }
        previous_filter_value = filter_value;
      }, filter_delay);
    });

    $icon_clear.click(function() {
      $filter_text.val("").change().focus();
      if (!is_array) {
        $term_filter.attr("aria-busy", true);
      }
    });

    function isFiltered(filter_text_value, $term_filter) {
      $term_filter.attr("aria-busy", false);

      if (filter_text_value.length === 0 ) {
        $term_filter.removeClass("filtered");
      } else {
        $term_filter.addClass("filtered");
      }
    }
  }
};
