cxo.flash_notices = {
  container: function() {
    return $("#flash_notices");
  },

  create: function(type, message, permanent) {
    var notice = $("<div class=\"" + type + "\">" + message + "</div>"),
    remove_notice = I18n.t('app.shared.notice.remove_notice');

    if(!permanent) {
      $('<button value="' + remove_notice + '" class="close"><span class="hide_absolutely">' +
          remove_notice + '</span></button>').bind("click", function() {
        cxo.flash_notices.remove($(this).parent());
      }).appendTo(notice);
    }

    return notice;
  },

  add: function(type, message, permanent) {
    var container = cxo.flash_notices.container();
    cxo.flash_notices.create(type, message, permanent).appendTo(container);
  },

  remove: function(notice) {
    notice.stop(true);
    notice.hide("fade", {}, 500);
  },

  clear: function() {
    cxo.flash_notices.container().html("");
  }
};
