(function() {
  "use strict";

  var $document         = $(document),
      subscribe_text    = I18n.t("app.widgets.general.subscribe"),
      unsubscribe_text  = I18n.t("app.widgets.general.unsubscribe"),
      subscribe_value   = I18n.t("app.widgets.general.subscribe_value"),
      unsubscribe_value = I18n.t("app.widgets.general.unsubscribe_value");

  cxo.following = {
    init: function() {
      $document.on("asyncTableComplete asyncLoadComplete",cxo.following.hover_shows_unfollow);
      $document.on("ajax:success", ".follow_form", cxo.following.update);
      $document.on("ajax:error", ".follow_form", cxo.following.failure);
      $document.on("ajax:success", ".subscribe_form", cxo.following.subscribe_update);
    },

    update: function(event, data, status, xhr) {
      var $this       = $(this),
          entity_id   = $this.find("input[name='entity_id']").val(),
          $sub_button = $this.next(".subscribe_form").find("button");

      $this.replaceWith(xhr.responseText);

      // Manage subscribe button activation state
      if (!$this.find("button").hasClass("following")) {
        cxo.following.subscribe_button_activate($sub_button);
      } else {
        cxo.following.subscribe_button_deactivate($sub_button);
      }

      $("input[name='entity_id'][value='" + entity_id + "']")
        .siblings("button").addClass("new");

      $.event.trigger("asyncTableComplete");
    },

    failure: function(event, xhr, status, error) {
      $(this).replaceWith(I18n.t("app.widgets.general.failed_to_load"));
    },

    hover_shows_unfollow: function() {
      $(".follow_form")
        .on("mouseenter focus", "button.following:not(.new)", function(e) {
          $(this)
            .text(I18n.t("app.widgets.general.unfollow"))
            .addClass("unfollow");
        })
        .on("mouseleave blur", "button.following", function(e) {
          $(this)
            .text(I18n.t("app.widgets.general.following"))
            .removeClass("unfollow new");
        });
    },

    subscribe_button_deactivate: function($subscribe_button) {
      $subscribe_button
        .removeClass("active email_subscribed")
        .attr("aria-label", subscribe_text)
        .find("span")
          .text(subscribe_text);

      if (!$subscribe_button.data("transition_bound")) {
        $subscribe_button.data("transition_bound", true);
        $subscribe_button.onEnd("transition", cxo.following.subscribe_hide_on_transition_end);
      }
    },

    subscribe_button_activate: function($subscribe_button) {
      $subscribe_button.removeClass("hidden");

      // Give the DOM a chance to see that the hidden class has been removed.
      // Ensures that the animation plays when active class is applied.
      appBuilder.utilities.refreshDomBeforeFunctionCall($subscribe_button, function() {
        $subscribe_button.addClass("active");
      });
    },

    subscribe_hide_on_transition_end: function() {
      var $this = $(this);

      // TODO: Refactor the follow button so that the container receives the "following" class
      // instead of the button itself. This will prevent this nasty lookup.
      if ($this.parent().prev(".follow_form").find("button").hasClass("following")) {
        return;
      }
      $this.addClass("hidden");
    },

    subscribe_update: function() {
      var $this        = $(this),
          $sub_button  = $this.find("button"),
          $button_text = $sub_button.find("span");

      $sub_button.toggleClass("email_subscribed");

      if ($sub_button.hasClass("email_subscribed")) {
        $sub_button
          .attr("aria-label", unsubscribe_text)
          .val(unsubscribe_value);

        $button_text.text(unsubscribe_text);

      } else {
        $sub_button
          .attr("aria-label", subscribe_text)
          .val(subscribe_value);

        $button_text.text(subscribe_text);
      }

      $sub_button.trigger("state_change");
    }
  };
})();
