// Setup and handle clicks for the help dialogs.

jQuery(function() {

  var options = {
    autoOpen: false,
    width: 500,
    minHeight: 50,
    draggable: false,
    resizable: false,
    closeOnEscape: true,
    dialogClass: "help",
    close: function() {
      var widget_name = $(this).attr("data-widget");

      $('.help_content[data-widget="' + widget_name + '"]:first')
        .closest(".help")
        .attr("aria-hidden", "true");
      appBuilder.utilities.overlay.disable();
    }
  };

  // Pre-create dialogs for each help content.
  $(".help_content").dialog(options).dialog();

  $("body").on("click", ".widget_header_action_button.help", function(event) {
    var help_dialog, other_dialogs, widget_name;

    // What dialog is this '?' hooked to?
    widget_name = $(this).attr("data-widget");
    help_dialog = $(".help_content[data-widget='" + widget_name + "']:first");

    // Close all other open help dialogs.
    other_dialogs = $(".help_content[data-widget != '" + widget_name + "']");
    other_dialogs.dialog().dialog("close");

    // Enable page overlay
    appBuilder.utilities.overlay.enable();

    // Open the pre-created dialog.
    help_dialog.dialog(options).dialog("open");
    help_dialog.dialog("option", "dialogClass", "help").dialog();

    $('.help_content[data-widget="' + widget_name + '"]:first')
      .closest(".help")
      .attr("aria-hidden", "false");
    appBuilder.utilities.overlay.increaseZindex();
  });

  cxo.hideHelpDialog = function(widget_name) {
    $(".help_content[data-widget='" + widget_name + "']").dialog("close");
  };

  return appBuilder.utilities.removeDialogs();
});
