function HovercardManager(options) {
  this.hovercard_endpoint = $("meta[name=hovercard-path]").attr("content");
  this.entity_link_selector = options.selector;
  this.doc = $(document);
  this.duration = 400;
  this.entity = new HoverEntity();
  this.card = new Hovercard();
  this.bindEvents();
}

HovercardManager.prototype.bindEvents = function() {
  this.bindClick(this);
  this.bindCardClick(this);
  this.bindHover(this);
  this.bindFocus(this);
  this.bindKeys(this);
};

HovercardManager.prototype.bindFocus = function(scope) {
  scope.doc.on("focusin", scope.entity_link_selector, function(e){
              scope.entity.over = true;
              scope.entity.element = $(this);
            })
            .on("focusout", scope.entity_link_selector, function(e){
              scope.entity.over = false;
            });

  scope.doc.on("focusout", function(e){
    if(scope.card.open && e.relatedTarget && $(e.relatedTarget).closest("#hovercard").length === 0) {
      scope.close(scope, e);
    }
  });
};

HovercardManager.prototype.bindHover = function(scope) {
  scope.doc.hoverIntent({
    over: function(e) {
      scope.over(scope, e, $(this));
    },
    out: function(e){
      scope.out(scope, e, $(this));
    },
    selector: scope.entity_link_selector,
    timeout: scope.duration
  });

  scope.doc.on("mouseover", scope.entity_link_selector, function(){
                scope.entity.over = true; })
            .on("mouseout", scope.entity_link_selector, function(){
                scope.entity.over = false; });

  scope.card.element.on("mouseover", function(){
                        scope.card.over = true; })
                    .on("mouseout", function(){
                        scope.card.over = false;});
};

HovercardManager.prototype.bindClick = function(scope) {
  scope.doc.children().not(scope.entity_link_selector).on("click", function(e){
    scope.out(scope);
  });
};

HovercardManager.prototype.bindCardClick = function(scope) {
  scope.card.element.on("click", function(e) {
    if (e.target && e.target.id === "hovercard") {
      scope.card.element.trapModalFocus();
    }
  });
};

HovercardManager.prototype.bindKeys = function(scope) {
  $(window).on("keydown", function bindKeysToWinHandler(event) {
    if (scope.card.open && (event.which === appBuilder.utilities.keys.enter)) {
      scope.card.over = true;
    }

    if (scope.entity.over && (event.which === appBuilder.utilities.keys.down)) {
      event.preventDefault();
      scope.card.over = true;
      scope.over(scope, event, scope.entity.element);
      scope.card.over = false; // keeps hovercard focus from overriding click out event
    }

    if (scope.card.open && (event.which === appBuilder.utilities.keys.escape)) {
      scope.close(scope, event);
    }
  });
};

HovercardManager.prototype.closeHandler = function(e) {
  var scope = e.data.scope;
  scope.close(scope, e);
};

HovercardManager.prototype.bindWindowResize = function(scope) {
  $(window).on("resize", { scope: scope }, scope.closeHandler);
  $(document).on("close_hovercard", { scope: scope }, scope.closeHandler);
};

HovercardManager.prototype.unbindWindowResize = function(scope) {
  $(window).off("resize", scope.closeHandler);
};

HovercardManager.prototype.close = function(scope, e) {
  e.preventDefault();
  scope.card.over = false;
  scope.entity.element.find("a").focus();
  scope.out(scope, e, scope.entity.element);
};

HovercardManager.prototype.over = function(scope, e, element) {
  scope.entity.element = element;

  if(!scope.card.open || (scope.entity.element !== scope.card.element)) {
    scope.refreshCard(scope, e.originalEvent.type);
    scope.bindWindowResize(scope);
  }
};

HovercardManager.prototype.out = function(scope){
  if( (scope.card.entity !== scope.entity.element) || (!scope.card.over && !scope.entity.over) ) {
    scope.card.element.hide();
    scope.card.element.attr("aria-hidden", true);
    scope.card.open = false;
    scope.unbindWindowResize(scope);
  }
};

HovercardManager.prototype.refreshCard = function(scope, event_type) {
  var id = scope.entity.element.attr("data-entity-id"),
      params = $.param({ id: id,
                         type: scope.entity.element.attr("data-entity-type")}),
      url    = scope.hovercard_endpoint + "?" + params;

  scope.card.entity = scope.entity.element;

  $.ajax({
    url: url,
    data: "",
    dataType: "html"
  }).done(function( jqXHR, textStatus, errorThrown ) {
    if(jqXHR && scope.entity.over && (scope.entity.element === scope.card.entity)) {
      scope.card.element.html(jqXHR);
      scope.setCardPosition(scope);
      scope.card.open = true;
      scope.card.element.attr("aria-hidden", false);
      scope.card.element.show();

      if (event_type === "keydown") {
        scope.card.element.trapModalFocus();
      }
    }
  });
};

HovercardManager.prototype.setCardPosition = function(scope) {
  var entityLinkBounds = scope.getElementBounds(scope.entity.element),
      viewBounds       = scope.getViewBounds($(window)),
      overflow         = scope.getOverflow(entityLinkBounds, viewBounds, scope.card.element);

  scope.card.position = {
    top: entityLinkBounds.top + scope.entity.element.height(),
    left: entityLinkBounds.left
  };

  scope.card.element.removeClass();

  if ( overflow.bottom ) {
    scope.card.position.top = entityLinkBounds.top - scope.card.element.outerHeight() - 30;
    scope.card.element.addClass("overflow_bottom");
  }

  if ( overflow.right ){
    scope.card.position.left = entityLinkBounds.right - scope.card.element.outerWidth();
    scope.card.element.addClass("overflow_right");
  }

  scope.card.element.css(scope.card.position);
};

HovercardManager.prototype.getViewBounds = function(view) {
  return { right: view.width(),
           bottom: view.scrollTop() + view.height() };
};

HovercardManager.prototype.getElementBounds = function($element) {
  return { top: $element.offset().top,
           right: $element.offset().left + $element.outerWidth(),
           bottom: $element.offset().top + $element.outerHeight(),
           left: $element.offset().left };
};

HovercardManager.prototype.getOverflow = function(entityLinkBounds, viewBounds, card) {
  return { bottom: entityLinkBounds.bottom + card.outerHeight() > viewBounds.bottom,
           right:  entityLinkBounds.left + card.outerWidth() > viewBounds.right };
};

function Hovercard() {
  $("#wrapper").append(HandlebarsTemplates["global/hovercard"]);

  this.element = $("#hovercard");
  this.over = false;
  this.open = false;
  this.entity = null;
  this.position = { top: null,
                    left: null};
}

function HoverEntity() {
  this.element = null;
  this.over = false;
  this.id = null;
}
