cxo.MobileNavigation = function(options) {
  this.mobile_toggle_class = "reveal_navigation";
  this.is_touch_device = 'ontouchstart' in document.documentElement;
  this.event_type = this.is_touch_device ? "touchstart.nav" : "click.nav";
  this.event_namespace = ".mobile_nav";

  this.$button = options.button;
  this.$menu = options.menu;
  this.$wrapper = $("#wrapper");
  this.$animation_elements = [ this.$button, this.$wrapper, this.$menu ];
  this.$overlay = $(".overlay");

  this.listen_for_button_clicks(this);
};

cxo.MobileNavigation.prototype = {
  listen_for_button_clicks: function(that) {
    this.$button.on(this.event_type, function(e) {
      e.preventDefault();
      that.show(that);
    });
  },

  listen_for_keyup: function(that) {
    var ESCAPE_KEY       = 27,
        namespaced_event = "keyup" + this.event_namespace;

    $(document).on(namespaced_event, function(e) {
      if (e.keyCode === ESCAPE_KEY && that.is_open()) {
        that.hide(that);
        $(document).unbind(namespaced_event);
      }
    });
  },

  listen_for_overlay_clicks: function(that) {
    var namespaced_event = this.event_type + this.event_namespace;

    this.$overlay.on(namespaced_event, function(){
      that.hide(that);
      $(this).unbind(namespaced_event);
    });
  },

  is_open: function() {
    return (this.$menu.attr("aria-hidden") === "false");
  },

  hide: function(that) {
    appBuilder.utilities.overlay.disable();

    this.$menu.attr("aria-hidden", true);
    $.each(this.$animation_elements, function() {
      this.removeClass(that.mobile_toggle_class);
    });
  },

  show: function(that) {
    appBuilder.utilities.overlay.enable();

    this.listen_for_keyup(that);
    this.listen_for_overlay_clicks(that);
    this.$menu
        .attr("aria-hidden", false)
        .find("nav li:first-child > a").focus();
    $.each(that.$animation_elements, function() {
      this.addClass(that.mobile_toggle_class);
    });
  }
};
