cxo.or_refinements_selection = {
  init: function(widget_id) {
    var item = $(".refinement.or_logic[data-widget-id='" + widget_id + "'] .widget_inside li a");
    item.on('click', function(e) {
      var stored_href = $(this).attr('href'),
          redirect_to = appBuilder.utilities.redirect_to;

      setTimeout(function() {
        redirect_to(stored_href);
        cxo.or_refinements_selection.disable_checkboxes();
        e.preventDefault();
      });
    });
  },

  disable_checkboxes: function() {
    $(".widget_inside").addClass("disable_checkboxes")
      .find("[type=checkbox]").attr("disabled", true);
  },

  checkbox_state: function(widget_id) {
    var checkboxes = $("." + widget_id + " input");
    checkboxes.on('change', function() {
      cxo.or_refinements_selection.toggle_changed_state($(this));
    });
   },

  toggle_changed_state: function(element) {
    if(element.attr("checked") === "checked"){
      element.attr("data-selected", "true");
    }

    var state = element.attr("data-changed") == "true" ? "false" : "true",
        selected = element.attr("data-selected") == "true" ? "false" : "true";

    element.attr("data-changed", state);
    element.attr("data-selected", selected);
  },

  submit_refinements: function(widget_id, base_refinement_url, action_route) {
    var $or_logic_submit_button = $("." + widget_id + " .or_logic_submit");
    $or_logic_submit_button.click(function() {
      cxo.or_refinements_selection.build_or_refinement_url(
        widget_id, base_refinement_url, action_route
      );
    });
  },

  build_or_refinement_url: function(widget_id, base_refinement_url, action_route) {
    var selected_boxes    = $("." + widget_id + " input[data-changed='true'][data-selected='true']"),
        deselected_boxes  = $("." + widget_id + " input[data-changed='true'][data-selected='false']"),
        selected_tokens   = cxo.or_refinements_selection.build_tokens(selected_boxes),
        deselected_tokens = cxo.or_refinements_selection.build_tokens(deselected_boxes);

    $.ajax({
      type: "POST",
      dataType: "json",
      url: action_route,
      data: {
        "base_refinement_url": base_refinement_url,
        "selected_tokens"    : selected_tokens,
        "deselected_tokens"  : deselected_tokens
      }
    }).done(function(response) {
        var merged_selected_tokens   = response.merged_selected_tokens,
            merged_deselected_tokens = response.merged_deselected_tokens,
            new_selected_params,
            new_deselected_params,
            new_url = base_refinement_url;

        if(merged_selected_tokens) {
          new_selected_params = "selected_tokens[]=" + escape(merged_selected_tokens);
          new_url = new_url + "&amp;" + new_selected_params;
        }

        if(merged_deselected_tokens) {
          new_deselected_params = "deselected_tokens[]=" + escape(merged_deselected_tokens);
          new_url = new_url + "&amp;" + new_deselected_params;
        }

        appBuilder.utilities.redirect_to(new_url);
    });
  },

  build_tokens: function(selected_checkboxes){
    var tokens =[];
    selected_checkboxes.each(function(){
      var id = $(this).attr("id"),
          label = $("label[for='"+id+"'] .label"),
          tokenString = label.attr("data-token");
      tokens.push(tokenString);
    });
    return tokens;
  }
};
