cxo.query_expansion = {
  scroll_page       : 0,
  max_page_set      : false,
  max_page          : 0,
  max_page_width    : 0,
  current_page      : 0,
  tabs              : null,
  list_position     : [],

  init: function() {

    // stores a reference to this object for deeper block calls
    var $that  = this;

    this.tabs = document.getElementById("query_expansion_tabs");

    $(window).resize(function() {
      $that.handleResize();
    });

    $(".query_navigation button").on("click", function(e) {
      e.preventDefault();

      if ($(this).hasClass("move_previous")) {
        $that.movePrevious();
      } else {
        $that.moveNext();
      }
    });

    $('#toggle_expansions').on("click", function(e) {
      e.preventDefault();

      $(".query_expansion_box").slideToggle("fast", function() {

        if ($(this).is(":visible")) {

          if ($that.hasOverflow(".query_expansion_tabs")) {
            $that.showNavigation();
            $that.setPagination();
          } else {
            $that.hideNavigation();
          }
        }
      });
    });

    $(".query_expansion_tab_button").on("click", function(event) {
      event.preventDefault();
    });

    $(".query_expansion_tabs").on("click keypress", "li", function(event) {
      var tabs        = $(".query_expansion_tabs li"),
          index       = tabs.index(this),
          tab_content = $(".query_tab_content"),
          active_tab  = $(".query_tab_content:eq(" + index + ")");

      if (appBuilder.utilities.a11yClick(event)) {
        tabs.removeClass("selected");
        $(this).addClass("selected");

        // activate tab content based on selected tab
        tab_content
          .removeClass("active")
          .addClass("inactive");

        active_tab
          .removeClass("inactive")
          .addClass("active");
      }
    });
  },

  handleResize: function() {
    var $that = this;

    if ($that.max_page_width !== $that.getMaxPageWidth()) {

      if ($that.hasOverflow(".query_expansion_tabs")) {
        $that.max_page_set = false;
        $that.showNavigation();
        $that.setPagination();
        $that.animate();
      } else {
        $that.hideNavigation();
      }
    }
  },

  setPagination: function() {
    var $that            = this,
        $tabs            = $(".query_expansion_tabs"),
        list_items       = $tabs.find("li"),
        total_item_width = 0;

    $('.query_navigation .move_next').removeClass('dim');

    $that.list_position = [0];

    list_items.each(function() {
      total_item_width += ($(this).outerWidth());

      if (total_item_width >= $that.max_page_width) {
          $that.list_position.push((this.offsetLeft) | 0);
          total_item_width = $(this).outerWidth();
      }
    });

    $that.max_page = $that.list_position.length - 1;
    $that.max_page_set = true;
  },

  animate: function() {
    var translate_value,
        list_length = this.list_position.length - 1;

    if (this.current_page > list_length) {
      this.current_page = list_length;
    }

    translate_value = this.list_position[this.current_page];

    if (appBuilder.utilities.supports3d()) {
      this.tabs.style.transform = 'translate3d(-' + translate_value + 'px, 0, 0)';
    } else {
       $(this.tabs).animate({
          left: '-' + translate_value
       }, 1000);
    }

    if (this.current_page == this.max_page) {
      $('.query_navigation .move_next').addClass('dim');
    } else if (this.current_page < this.max_page) {
      $('.query_navigation .move_next').removeClass('dim');
    }
  },

  movePrevious: function() {
    var $that = this;

    if (this.current_page > 0) {
      --this.current_page;

      $that.animate();
      $('.query_navigation').find('.dim').removeClass('dim');

      if (this.current_page === 0) {
        $('.query_navigation .move_previous').addClass('dim');
      }
    }
  },

  moveNext: function() {
    var $that = this;

    if (this.current_page < this.max_page) {
      ++this.current_page;

      $that.animate();
      $('.query_navigation').find('.dim').removeClass('dim');

      if (this.current_page === this.max_page) {
        $('.query_navigation .move_next').addClass('dim');
      }
    }
  },

  showNavigation: function() {
    $(".query_navigation").css({
      height       : "auto",
      visibility   :  "visible",
      marginBottom : ".5em"
    });
  },

  hideNavigation: function() {
    $(".query_navigation").css({
      height          : 0,
      visibility      : "hidden",
      marginBottom    : 0
    });
  },

  getMaxPageWidth: function() {
    return $('#query_expansion > form').outerWidth();
  },

  hasOverflow: function(elem) {
    var $container       = $(elem),
        $that            = this,
        $parent          = $('.search_refinements'),
        list_items       = null,
        total_item_width = 0;

    this.max_page_width = this.getMaxPageWidth();

    list_items = $container.find("li");
    list_items.each(function() {
      total_item_width += $(this).outerWidth();
    });

    if (total_item_width > this.max_page_width) {
      $parent.addClass("overflowed");
      return true;
    } else {
      $parent.removeClass("overflowed");
      return false;
    }
  }
};
