cxo.RecentWorkspaces = function(options){
  this.$button = options.button;
  this.$menu = options.menu;
  this.$list = this.$menu.find(".recent_workspaces_list");
  this.$path = $("meta[name='recent-workspaces-path']").attr("content");
  this.key = "recent_workspaces";

  this.bind(this);
};

cxo.RecentWorkspaces.prototype = {
  bind: function(scope) {
    $(document).on("recent_workspaces:update", function(){
      scope.getRecent(scope);
    });

    window.addEventListener("storage", function(event){
      scope.fetchValue(event, scope);
    }, false);
  },

  getRecent: function(scope) {
    $.get(scope.$path)
      .done(function(data) {
        appBuilder.utilities.setWebStorage(scope.key, data);
        scope.updateList(scope, data);
      }
    );
  },

  fetchValue: function(e, scope) {
    if (e.key === scope.key) {
      scope.updateList(scope, e.newValue);
    }
  },

  updateList: function(scope, data){
    scope.$list.children().remove();
    scope.$list.append(data);
  }
};
