cxo.rich_preview = {
  init: function() {
    var event_type = appBuilder.utilities.ie() === 8 ? "mousedown" : "click";

    $(".preview_link").on(event_type, function(event) {
      cxo.rich_preview.open_on_left_click($(this), event);
    });

    $(document).on("keydown", function(event) {
      var ESCAPE_KEY = 27;
      if (event.keyCode === ESCAPE_KEY && cxo.rich_preview.has_preview()) {
        cxo.rich_preview.remove_preview_modal();
      }
    });
  },

  open_on_left_click: function(element, event) {
    var url = element.attr("href"),
        ctrl = event.ctrlKey,
        meta = event.metaKey,
        shift = event.shiftKey;

    if(cxo.rich_preview.detect_left_button(event) === true && !ctrl && !meta && !shift) {
      event.preventDefault();
      cxo.rich_preview.add_preview_modal(url);
    }
  },

  add_preview_modal: function(url) {
    var url_with_param = url + "&embedded=true";

    if(cxo.rich_preview.has_preview()){
      cxo.rich_preview.remove_preview_modal();
    }

    appBuilder.utilities.overlay.enable();
    appBuilder.utilities.overlay.increaseZindex();
    cxo.rich_preview.add_close_button();

    $("body")
      .append($("<iframe aria-busy='true' tabindex='-1' title='" + I18n.t('app.preview.rich_preview_frame') + "' id='rich_preview'/>")
      .attr("src", url_with_param))
      .addClass("no_scroll");

    $("#rich_preview")[0].contentWindow.focus();
  },

  add_close_button: function() {

    $("body").append($("<span id='preview_close_button' title='" + I18n.t('app.preview.close_preview_frame') + "'></span>"));

    $("#preview_close_button").on("click", function(event){
      cxo.rich_preview.remove_preview_modal();
    });
  },

  remove_close_button: function() {
    $("#preview_close_button").remove();
    $("#preview_close_button").unbind();
  },

  remove_preview_modal: function() {
    appBuilder.utilities.overlay.disable();
    cxo.rich_preview.remove_close_button();
    $("#rich_preview").remove();
    $("body").removeClass("no_scroll");
  },

  has_preview: function() {
    return ($("#rich_preview").length > 0);
  },

  detect_left_button: function(e) {
    e = e || window.event;
    var button = e.which || e.button;
    return button == 1;
  },

  hide_loading_spinner: function() {
    $("#rich_preview").attr("aria-busy", "false");
  }
};
