cxo.search_box = {
  setSearchContext: function($search_box) {
    var context = $search_box.find(".ctx");
    if(context.length > 0) {
      $search_box.find(".current_search_context").text(context.find("option:selected").text());
    }
  },

  init: function(element) {
    //Path for account search used by autocomplete
    var $search_box = element,
        autocomplete_search_path = $("meta[name='autocomplete-search-path']").attr("content"),
        $search_input;

    // Autocomplete for all search forms
    $(".q").each(function() {
      $search_input = $(this);
      $search_input.catcomplete({
        appendTo: $search_input.closest("[data-based-on='search_box']"),
        source:   autocomplete_search_path,
        select:   function( event, ui ) {
          appBuilder.utilities.redirect_to(ui.item.url);
        },
        create: function( event, ui ) {
          $("<li></li>")
            .text(I18n.t("app.widgets.search_box.empty"))
            .appendTo($search_box.find(".ui-autocomplete"));
        }
      }).focus(function() {
        $(this).catcomplete("search");
      });

      if(!$search_input.val()) {
        $search_input.focus();
      }
    });

    // Initialize the search box context
    cxo.search_box.setSearchContext($search_box);

    // Set the search context when a new one is selected
    $search_box.find(".ctx").on("change", function() {
      cxo.search_box.setSearchContext($search_box);
    });
  },

  displayAutocompleteFields: function(autocomplete_result) {
    var autocompleteFields = "",
        autocompleteClasslist = "entity-link no-link autocomplete-field";


    if (autocomplete_result.fields.length > 0) {

      for (var i = 0; i < autocomplete_result.fields.length; i++) {
        autocompleteFields += '<section class="' + autocompleteClasslist + '">' +
                           autocomplete_result.fields[i].label + ' ' +
                           autocomplete_result.fields[i].value +
                           '</section>';
      }
      autocompleteFields = '<article class="autocomplete-fields">' +
                          autocompleteFields +
                          '</article>';
    }

    return autocompleteFields;
  }
};
