function ShowAllDialog(options) {
  this.button = options.button;
  this.dialog = options.dialog;
  this.dialog_content = $(this.dialog).find(".content");
  this.document = $(document);
  this.url = this.button.attr("href");
  this.sort_button_selector = ".show_all_sort_button";

  this.button.flyout_dialog(this.dialog, function() {});
  this.bindDialog(this);
}

ShowAllDialog.prototype.bindDialog = function(scope) {
  scope.button.on("click keypress", function(e){
    if (appBuilder.utilities.a11yClick(e)) {
      e.preventDefault();
      scope.load(scope, scope.url);
    }
  });
};

ShowAllDialog.prototype.bindSortButtons = function(scope) {
  scope.document.one("click keypress", scope.sort_button_selector, function(e) {
    var url = $(this).attr("href");
    if (appBuilder.utilities.a11yClick(e)) {
      e.preventDefault();
      scope.load(scope, url);
    }
  });
};

ShowAllDialog.prototype.load = function(scope, url) {
  scope.dialog_content.html(HandlebarsTemplates["global/spinner"]);
  scope.dialog_content.load(url, function(){
    cxo.show_all_refinements.init();
    cxo.toggle_refinements.init(scope.dialog);
    scope.bindSortButtons(scope);
    $("#show_all_filter").focus();
  });
};

cxo.show_all_refinements = {
  init: function() {
    var items = $("section.show_all li"),
        columns = $("section.show_all ul.stem");

    jQuery.expr[':'].Contains = function(a, i, m) {
      return jQuery(a).text().toUpperCase().indexOf(m[3].toUpperCase()) >= 0;
    };

    $(document).bind('filtered', function(event, filter) {
      cxo.show_all_refinements.filter(filter, items, columns);
    });

    $('#show_all_filter').bindFilterShowAll();
  },

  filter: function(input, items, columns) {
    if (input.length !== 0){
      items.each(function(){
        var item = $(this);
        if (item.find(".label:Contains('" + input + "')").length !== 0){
          item.removeClass("hidden");
        } else{
          item.addClass("hidden");
        }
      });
      columns.each(function(){
        var column = $(this);
        if (column.children().length == column.children("li.hidden").length){
          column.addClass("hidden");
        } else{
          column.removeClass("hidden");
        }
      });
    } else {
      items.removeClass("hidden");
      columns.removeClass("hidden");
    }
  }
};

$.fn.bindFilterShowAll = function() {
  var do_filter_timeout;
  var previous_filter_value;
  return $(this).bind('keydown paste', function(event) {
    clearTimeout(do_filter_timeout);
    var filter_input = this;
    do_filter_timeout = setTimeout(function() {
      var filter_value = $(filter_input).val();
      if (filter_value != previous_filter_value) {
        $(document).trigger('filtered', filter_value);
      }
      previous_filter_value = filter_value;
    }, 400);
  });
};
