cxo.tabbed_content = {
  init: function(table_config) {
    var $filters = $("#" + table_config.id + "_type_filters"),
        $table   = $("#" + table_config.id + "_table"),
        $loading_spinner;

    $filters.tabs({
      activate: function(event, ui) {
        var existing_params = $table.data("dt_params");
        $table.data("dt_params", $.extend(existing_params, {"type_filter" : ui.newTab.data("type-filter")}));

        if($table.length > 0) {
          $table.DataTable().ajax.reload();
        }
      }
    });

    cxo.dataTable.init(table_config);

    $table.on("click", ".icon_remove", function(){
      $loading_spinner = $("#" + table_config.id + "_table_processing");
      $loading_spinner.attr("aria-busy", true).show();

      var $entity_link_div = $(this).closest("tr").find("div"),
          entity_id        = $entity_link_div.data("entity-id"),
          entity_type      = $entity_link_div.data("entity-type");

      $.ajax({
        url      : table_config.delete_path,
        type     : "delete",
        dataType : "text",
        data     : {
          "entity_id"   : entity_id,
          "entity_type" : entity_type,
          "space_id"    : table_config.space_id
        },
        success  : function () {
          $table.DataTable().row($(this).closest("tr")).remove().draw();
        }
      });
    });
  }
};
