cxo.toggle_refinements = {
  init: function(selector) {
    var elements = $(selector),
        expanded_items = elements.find("li.selected, .expand_all li"),
        toggle_buttons = elements.find(".toggle_refinement");

    expanded_items.addClass("expanded");
    toggle_buttons.on("click", function(event) {
      var this_element = $(this),
          parent = this_element.parent("li"),
          hasChildren = this_element.siblings("ul").length > 0,
          expanded = parent.hasClass("expanded");

      if ( expanded ) {
        cxo.toggle_refinements.collapse( parent );
      } else if ( !expanded && hasChildren ) {
        cxo.toggle_refinements.expand( parent );
      }

      event.preventDefault();
    });
  },

  expand: function(e) {
    e.children("ul").slideDown("fast");
    e.addClass("expanded");
    e.removeClass("collapsed");
  },

  collapse: function(e) {
    e.children("ul").slideUp("fast");
    e.removeClass("expanded");
    e.addClass("collapsed");
  }
};
