(function() {
  "use strict";

  cxo.workspace_description = {
    init: function(widget_id) {
      var $entity_information    = $("[data-widget-id='" + widget_id + "'].entity_information"),
          $edit_description_form = $entity_information.find(".edit_description_form"),
          $description_input     = $edit_description_form.find(".edit_workspace_description"),
          $content_editable      = $description_input.closest(".content_editable"),
          $description_submit    = $edit_description_form.find("[type=submit]"),
          typing_interval        = 1500,
          typing_timer;

      function showSuccess() {
        new Alert({ content: I18n.t('app.widgets.entity_information.success_message') });
      }

      function showError() {
        new Alert({ content: I18n.t('app.widgets.entity_information.error_message'), is_error: true });
      }

      function keydownHandler(event) {
        var util            = appBuilder.utilities,
            which           = event.which,
            key             = util.keyToString(which),
            tabkey_pressed  = (which === util.keys.tab),
            metakey_pressed = (event.ctrlKey || event.metaKey);

        if (!(tabkey_pressed || metakey_pressed) &&
            /[a-zA-Z0-9\s\b]/.test(key) || event.type === "paste") {
          clearTimeout(typing_timer);
          typing_timer = setTimeout(function() {
            cxo.workspace_description.inputComplete($description_submit);
          }, typing_interval);
        }
      }

      $description_input.on("keydown paste", keydownHandler);
      $edit_description_form.on("ajax:success", showSuccess);
      $edit_description_form.on("ajax:error", showError);
    },
    inputComplete: function($submit) {
      $submit.trigger("click");
    }
  };
})();
